import React, { Fragment, useEffect } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import Spinner from "../layout/Spinner";
import { getOpcens } from "../../actions/opcen";

const Opcens = ({ getOpcens, opcen: { opcens, loading } }) => {
  useEffect(() => {
    getOpcens(user);
  }, [getOpcens]);
  return loading ? (
    <Spinner />
  ) : (
    <Fragment>
      <p className='lead'>
        <i className='fas fa-user'></i> Choose an Operation Center
      </p>
    </Fragment>
  );
};

Opcens.propTypes = {
  getOpcens: PropTypes.func.isRequired,
};

const mapStateToProps = state => ({
  opcen: state.opcen,
});

export default connect(mapStateToProps, { getOpcens })(Opcens);
